import React from "react";

import "./Projects.css";

import Project from "../Project/Project";

const Projects = () => {
  return (
    <div className="Projects d-flex flex-row justify-content-center align-items-center flex-wrap p-0">
      <Project />
      <Project />
      <Project />
      <Project />
      <Project />
      <Project />
    </div>
  );
};

export default Projects;
